import './style/App.css';


const COMMENTS = []

function GetPosts() {
  const comments = fetch('https://jsonplaceholder.typicode.com/comments/?_limit=10')
  .then((response) => response.json())
  .then((json) => {
    let comment = {
      postId: {},
      name: {},
      body: {},
      email: {},
    };
    COMMENTS.push(comment);
  })

  return (
    <table>
      <thead>
        <tr>{comments.name}</tr>
        <tr>Body</tr>
        <tr>Email</tr>
      </thead>
      <tbody>123</tbody><tbody>123</tbody><tbody>123</tbody>
    </table>
  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <GetPosts />
      </header>
    </div>
  );
}

export default App;
